    switch (type) {
        case "textarea":
            return (
                <input placeholder={placeholder} className={recievedStyle} />
            );
        case "select":
            return <select placeholder={placeholder} />;
        default:
            return (
                <React.Fragment>
                    <input type="text" {...props} />
                </React.Fragment>
            );
    }
};

export default Input;
